import React from "react";
import Layout from "../components/LayoutModule/Layout";
import AddCategoryForm from "../components/AddCategoryModule";
import CategoriesList from "../components/ListCategoriesModule";
import { loadCategories } from "../redux/Categories/actions";
import {connect} from "react-redux";
import  {categories} from "../constants/categoriesList";
import CssBaseline from "@material-ui/core/CssBaseline";

const Index = () => (
    <Layout>
        <CssBaseline/>
        <CategoriesList/>
        <AddCategoryForm/>
    </Layout>

);

Index.getInitialProps = async (props) => {
    const { store } = props.ctx;
    if (store.getState().categoryData.categories.length === 0) {
        await store.dispatch(loadCategories(categories));
    }
};

export default connect()(Index);

import { actionTypes } from '../../constants/actionTypes'

export function loadCategories(categories) {
    return {
        type: actionTypes.LOAD_CATEGORIES,
        payload: categories,
    }
}

export function addCurrentCategory(category) {
    return {
        type: actionTypes.ADD_CURRENT_CATEGORY,
        payload: category,
    }
}

export function addNewCategory(category) {
    return {
        type: actionTypes.ADD_NEW_CATEGORY,
        payload: category,
    }
}

export function addCategoryInList(category) {
    return {
        type: actionTypes.ADD_CATEGORY_IN_LIST,
        payload: category,
    }
}

import { createSelector } from 'reselect';

const getCategoryData = (state) => state.categoryData;

export const getCurrentCategory = createSelector(
    getCategoryData,
    (categoryData) => categoryData.currentCategory
);

export const getCategories = createSelector(
    getCategoryData,
    (categoryData) => categoryData.categories
);

export const getNewCategory = createSelector(
    getCategoryData,
    (categoryData) => categoryData.newCategory
)

import { createSelector } from 'reselect';

const getNewsData = (state) => state.newsData;

export const getNews = createSelector(
